description:
Organik yenidoğan çıtçıtlı bebek tulumu dünyanın en iyi pamukları arasında gösterilen 100 % organik Ege pamuğundan üretilmiştir .&nbsp;

Ege pamuğunun uzun lifleri sayesinde ürünlerimiz daha uzun süreli bir dayanıma sahiptir.

Ürünümüz GOTS Organik Sertifikalıdır.&nbsp;

Herhangi bir boyarmadde içermemektedir . Çocuklarınızın ve çevrenizin sağlığı için yalnızca yıkama yapılmıştır .&nbsp;

Ürünlerimizde yüksek kaliteli 30/1 organik penye ipliği kullanılmaktadır .&nbsp;

% 100 Türk malıdır . Ürünlerimizin ilk üretim hammaddesi olan pamuktan son aşamasına kadar tüm üretim Türkiye'de yapılmıştır .&nbsp;

Çevreye olan duyarlılığınızdan ve gelecek nesillere daha yaşanabilir bir dünya bırakabilmemizdeki desteğinizden dolayı toprak ana ve doğa adına teşekkürler ...

