Ürün Özellikleri:
&nbsp;

9 kg’a kadar bebekler için uygundur. 
Bebeğinize düz yatma pozisyonu sunar.
Son derece hafif ve taşıması kolaydır.
Güvenli ve kolay taşımanız için yanlarında sağlam taşıma sapları bulunur.
Büyük tentesi bebeğinize maksimum konfor sunar.&nbsp; 
Connect³ bebek arabasına kolayca takılır.
